column3:
Скористайтеся наведеними нижче параметрами, щоб визначити, коли потрібно попереджати вас про підозрілі дії, які інша програма намагається виконати програмним шляхом, зокрема:

     •     отримати доступ до вашої адресної книги та відомостей про адреси електронної пошти;
     •     надсилати повідомлення електронної пошти від вашого імені.
